var StoreVue=new Vue({el:"#store-vue",data:{paymentHistoryID:null,isSaving:!1,textMessage:null,textError:null},watch:{},mounted:function(){},methods:{pay:function(){return $.ajax({type:"Get",url:"/Store/PayStart",context:this,data:JSON.stringify({tariff:"Free"}),contentType:"application/json; charset=utf-8",dataType:"json",success:function(n){return n.isOk?(this.paymentHistoryID=n.paymentHistoryID,this.textMessage="Оплата прошла успешно"):this.textError="Извините, оплата не прошла",n},error:function(n,t,i){this.isSaving=!1;console.log(i)}})},returnFromPayment:function(){return $.ajax({type:"Get",url:"/Store/PayFinish?paymentID="+this.paymentHistoryID,context:this,contentType:"application/json; charset=utf-8",dataType:"json",success:function(n){return n.isOk,n},error:function(n,t,i){this.isSaving=!1;console.log(i)}})}}});